import React, {useEffect, useState} from 'react';
import './App.css';
import FruitCounter from "./components/Fruitcounter/FruitCounter";
import Form from "./components/CompleteForm/Form";

function App() {
    const handleSubmit = (formData) => {
        console.log(formData);
    };
    const [reset, setReset] = useState(false)
    const resetFruitCounter = () =>{
        setReset(true)
    }
    useEffect(() => {
        if (reset) {
            setTimeout(() => setReset(false), 100);
        }
    }, [reset]);
    return (
        <>
            <h1>Fruitmand bezorgservice</h1>
            <FruitCounter
                imageLink="data:image/jpeg;base64,"
                kindOfFruit="Aarbeien "
                reset={reset}
            />
            <FruitCounter
            imageLink="data:image/jpeg;base64,"
            kindOfFruit="Bananen "
            reset={reset}
            />
            <FruitCounter
                imageLink="data:image/jpeg;base64,"
                kindOfFruit="Appels "
                reset={reset}
            />
            <FruitCounter
                imageLink="data:image/jpeg;base64,"
                kindOfFruit="Kiwi's "
                reset={reset}
            />
            <button
                className="reset-button"
                type={"button"}
                onClick={resetFruitCounter}>
                Reset
            </button>
            <Form
            onSubmit={handleSubmit}
            />
        </>
    );
}

export default App;
